        }
        let executionResult = await executeImporterModuleTask("Intent.Modules.SqlServerImporter.Tasks.StoredProcedureImport", importModel);
        if (((_a = executionResult.errors) === null || _a === void 0 ? void 0 : _a.length) > 0) {
